import React from "react";
import { View, Pressable, StyleSheet, ScrollView } from "react-native";
import {Xmark} from "iconoir-react-native";
import StyledText from "../../src/styles/StyledText"
import string from "../../src/string/string"
import StyledItemProduct from "../../src/styles/StyledItemProduct";
import Constants from 'expo-constants'

const FavoriteClient = () =>{

    return(

        <View style={styles.container}>
            <View style={styles.header}>
                <Pressable>
                    <Xmark width={30} height={30} color={"black"}/>
                </Pressable>

                <StyledText> {string.client.favoriteStore} </StyledText>   
            </View>

            <View style={styles.containerScroll}>
                <ScrollView style={styles.containerScroll}>
                    <StyledItemProduct store></StyledItemProduct>
                </ScrollView>
            </View>

        </View>

    )

}

const styles = StyleSheet.create({
    container:{
        marginTop: Constants.statusBarHeight,
    },
    header:{
        flexDirection:"row",
        justifyContent:"space-around"
    },
    scroll:{
        with:300,
        padding:"auto",
        marginTop:20,
    },
    containerScroll:{
        with:1,
        alignItems:"center"
    }
})

export default FavoriteClient;
